import React, { Component } from "react";
import Link from "next/link";
import styles from "./SideBarNav.module.css";
import { ChevronsLeft } from "react-feather";

const Username = () => {
  return "Alexandra"
}

export default class SideBarNav extends Component {
  constructor(props) {
    super(props);
    this.wrapperRef = React.createRef();
  }

  handleClick = () => {
    const wrapper = this.wrapperRef.current;
    wrapper.classList.toggle('is-nav-open')
  }

  render() {
    return (
      <div ref={this.wrapperRef} className="wrapper">
        <nav className={styles.sidebarcontainer}>
          <div className={styles.navIconButton}>
            <ChevronsLeft />
          </div>
          <img
            src="/medstar-health.png"
            className="img-fluid p-3"
            alt="Medstar Health logo"
          />
          <div className={styles.navLinks}>
            <ul className="nav-links">
              <Link href="/">
                <a className="py-1">Your Hosptial</a>
              </Link>
              <Link href="/">
                <a className="py-1">Activity</a>
              </Link>
              <Link href="/">
                <a className="py-1">
                  <Username />
                </a>
              </Link>
              <Link href="/search">
                <a className="py-1">Search</a>
              </Link>
              <Link href="/">
                <a className="py-1">Courses</a>
              </Link>
              <Link href="/">
                <a className="py-1">Calander</a>
              </Link>
              <Link href="/">
                <a className="py-1">Messages</a>
              </Link>
            </ul>
          </div>
        </nav>
      </div>
    );
  }
}
